document.addEventListener('DOMContentLoaded', function() {
    const loginForm = document.getElementById('loginForm');
    const compraTable = document.getElementById('compraTable');
    const addRowButton = document.getElementById('addRow');

    if (loginForm) {
        loginForm.addEventListener('submit', function(e) {
            e.preventDefault();
            const correo = document.getElementById('correo').value;
            const nombre = document.getElementById('nombre').value;
            const cliente = clientes.find(c => c.correo === correo);
            if (cliente) {
                localStorage.setItem('correoUsuario', correo);
                localStorage.setItem('nombreUsuario', cliente.nombre);
                window.location.href = 'formulario.html';
            } else {
                alert('Usuario no encontrado');
            }
        });
    }

    if (compraTable) {
        addRowButton.addEventListener('click', addRow);
        autocompletarFormulario();
        actualizarBotonEnviar(); // Llamada inicial para verificar el estado del botón
    }
});

function autocompletarFormulario() {
    const correoUsuario = localStorage.getItem('correoUsuario');
    const nombreUsuario = localStorage.getItem('nombreUsuario');
    const nombreSolicitante = document.getElementById('nombreSolicitante');
    const direccionEntrega = document.getElementById('direccionEntrega');

    if (correoUsuario && nombreUsuario) {
        nombreSolicitante.value = nombreUsuario;
        const cliente = clientes.find(c => c.correo === correoUsuario);
        if (cliente) {
            if (cliente.direcciones.length > 1) {
                // Si hay múltiples direcciones, crear un select
                const select = document.createElement('select');
                select.id = 'direccionEntrega';
                select.style.width = '100%'; // Asegura que el select ocupe todo el ancho
                select.style.height = '40px'; // Mantiene la misma altura que el input
                cliente.direcciones.forEach(dir => {
                    const option = document.createElement('option');
                    option.value = dir;
                    option.textContent = dir;
                    select.appendChild(option);
                });
                direccionEntrega.parentNode.replaceChild(select, direccionEntrega);
            } else if (cliente.direcciones.length === 1) {
                direccionEntrega.value = cliente.direcciones[0];
            }
        }
    }
}

function addRow() {
    const compraBody = document.getElementById('compraBody');
    const newRow = compraBody.insertRow();
    newRow.innerHTML = `
        <td><input type="text" placeholder="Referencia" onkeyup="buscarRepuesto(this, 'referencia')"></td>
        <td><input type="text" placeholder="Descripción" onkeyup="buscarRepuesto(this, 'descripcion')"></td>
        <td>
            <div class="quantity-control">
                <button onclick="changeQuantity(this, -1)">-</button>
                <span>0</span>
                <button onclick="changeQuantity(this, 1)">+</button>
            </div>
        </td>
        <td>
            <button class="delete-btn" onclick="deleteRow(this)">
                <i class="fas fa-trash"></i>
            </button>
        </td>
    `;
    actualizarBotonEnviar();
}

function buscarRepuesto(input, tipo) {
    const termino = input.value.toLowerCase();
    if (termino.length < 2) return; // Busca si hay al menos 2 caracteres

    const palabras = termino.split(/\s+/).filter(palabra => palabra.length > 1);

    const resultados = repuestos.filter(r => {
        if (r && typeof r === 'object') {
            if (tipo === 'referencia') {
                return r.REFERENCIA && r.REFERENCIA.toLowerCase().includes(termino);
            } else if (tipo === 'descripcion') {
                const textoCompleto = [
                    r.DESCRIPCIÓN,
                    r.GRUPO,
                    r.MÁQUINA,
                    r.COMENTARIO
                ].filter(Boolean).join(' ').toLowerCase();

                return palabras.every(palabra => textoCompleto.includes(palabra));
            }
        }
        return false;
    });

    mostrarResultados(input, resultados, tipo);
}

function mostrarResultados(input, resultados, tipo) {
    let resultadosDiv = input.parentNode.querySelector('.resultados-busqueda');
    if (!resultadosDiv) {
        resultadosDiv = document.createElement('div');
        resultadosDiv.className = 'resultados-busqueda';
        input.parentNode.appendChild(resultadosDiv);
    }

    resultadosDiv.innerHTML = '';
    const palabras = input.value.toLowerCase().split(/\s+/).filter(palabra => palabra.length > 1);

    resultados.forEach(r => {
        const div = document.createElement('div');
        if (tipo === 'referencia') {
            div.innerHTML = resaltarPalabras(`${r.REFERENCIA} - ${r.DESCRIPCIÓN}`, palabras);
        } else {
            div.innerHTML = `
                <strong>${resaltarPalabras(r.DESCRIPCIÓN, palabras)}</strong><br>
                Ref: ${r.REFERENCIA}<br>
                Grupo: ${resaltarPalabras(r.GRUPO || 'N/A', palabras)}<br>
                Máquina: ${resaltarPalabras(r.MÁQUINA || 'N/A', palabras)}<br>
                Comentario: ${resaltarPalabras(r.COMENTARIO || 'N/A', palabras)}
            `;
        }
        div.onclick = function() {
            if (tipo === 'referencia') {
                input.value = r.REFERENCIA;
                input.parentNode.nextElementSibling.querySelector('input').value = r.DESCRIPCIÓN;
            } else {
                input.value = r.DESCRIPCIÓN;
                input.parentNode.previousElementSibling.querySelector('input').value = r.REFERENCIA;
            }
            resultadosDiv.innerHTML = '';
        };
        resultadosDiv.appendChild(div);
    });
}

function resaltarPalabras(texto, palabras) {
    let resultado = texto;
    palabras.forEach(palabra => {
        const regex = new RegExp(palabra, 'gi');
        resultado = resultado.replace(regex, match => `<mark>${match}</mark>`);
    });
    return resultado;
}

function changeQuantity(button, change) {
    const quantitySpan = button.parentElement.querySelector('span');
    let quantity = parseInt(quantitySpan.textContent);
    quantity = Math.max(0, quantity + change);
    quantitySpan.textContent = quantity;
    actualizarBotonEnviar();
}

function deleteRow(button) {
    if (confirm('¿Está seguro de que desea eliminar esta fila?')) {
        const row = button.closest('tr');
        row.remove();
    }
    actualizarBotonEnviar();
}

function actualizarBotonEnviar() {
    const compraBody = document.getElementById('compraBody');
    const filas = compraBody.getElementsByTagName('tr');
    const enviarSolicitudBtn = document.getElementById('enviarSolicitud');
    
    let filasValidas = 0;
    
    for (let fila of filas) {
        const cantidad = parseInt(fila.querySelector('.quantity-control span').textContent);
        const referencia = fila.querySelector('input[placeholder="Referencia"]').value;
        if (cantidad > 0 && referencia.trim() !== '') {
            filasValidas++;
        }
    }
    
    enviarSolicitudBtn.style.display = filasValidas > 1 ? 'block' : 'none';
}

// Añadir funcionalidad al botón de enviar solicitud
document.getElementById('enviarSolicitud').addEventListener('click', function() {
    mostrarResumen();
});

function mostrarResumen() {
    const compraBody = document.getElementById('compraBody');
    const filas = compraBody.getElementsByTagName('tr');
    let resumenHTML = '<table><tr><th>Referencia</th><th>Descripción</th><th>Cantidad</th></tr>';
    
    for (let fila of filas) {
        const referencia = fila.querySelector('input[placeholder="Referencia"]').value;
        const descripcion = fila.querySelector('input[placeholder="Descripción"]').value;
        const cantidad = fila.querySelector('.quantity-control span').textContent;
        
        if (cantidad > 0 && referencia.trim() !== '') {
            resumenHTML += `<tr><td>${referencia}</td><td>${descripcion}</td><td>${cantidad}</td></tr>`;
        }
    }
    
    resumenHTML += '</table>';
    
    const nombreSolicitante = document.getElementById('nombreSolicitante').value;
    const direccionEntrega = document.getElementById('direccionEntrega').value;
    
    resumenHTML += `<p><strong>Solicitante:</strong> ${nombreSolicitante}</p>`;
    resumenHTML += `<p><strong>Dirección de entrega:</strong> ${direccionEntrega}</p>`;
    
    document.getElementById('resumenContenido').innerHTML = resumenHTML;
    document.getElementById('resumenModal').style.display = 'block';
}

// Cerrar el modal cuando se hace clic en la X
document.querySelector('.close').addEventListener('click', function() {
    document.getElementById('resumenModal').style.display = 'none';
});

// Cerrar el modal cuando se hace clic fuera de él
window.addEventListener('click', function(event) {
    if (event.target == document.getElementById('resumenModal')) {
        document.getElementById('resumenModal').style.display = 'none';
    }
});

